import React, { Component } from 'react';
import './App.css';
class Nbres_de_pas extends Component{
    render(){
        return(
            <div className="Nbres_de_pas">
            <h3>NBRES DE PAS </h3>
            <h4 className="Pas-today">6000</h4>
            <h5 className="Pas-Yesterday">Hier : 4512</h5>
            
            </div>
      );
    }



}
export default Nbres_de_pas;
